import logo from './logo.svg';
import './App.css';
import DoubleSlider from './doubleSlider';
import React, { useState } from 'react';

function App() {
  const [sliderVState, setSliderVState] = useState(1);
  const [sliderHState, setSliderHState] = useState(1);
  return (
    <div className="App">
      <header className="App-header">
        <DoubleSlider 
        sliderVState={sliderVState}
        setSliderVState={setSliderVState}
        sliderHState={sliderHState}
        setSliderHState={setSliderHState}
        >
        </DoubleSlider>
      </header>
    </div>
  );
}

export default App;
